import React from "react";

const Rating = ({ value, text }) => {
  const ratings = [0, 1, 2, 3, 4];
  console.log(ratings);
  return (
    <div className="rating">
      <span>
        <i
          class={
            value >= 1
              ? "fa-solid fa-star"
              : value >= 0.5
              ? "fa-regular fa-star"
              : "fa-regular fa-star-half-stroke"
          }
        ></i>
      </span>

      {ratings.map((j) => {
        {
          <span>
            <i
              class={
                value >= 1
                  ? "fa-solid fa-star"
                  : value >= 0.5
                  ? "fa-regular fa-star"
                  : "fa-regular fa-star-half-stroke"
              }
            ></i>
          </span>;
        }
      })}
      <span> {text && text} </span>
    </div>
  );
};

export default Rating;
